import React, { Component } from "react";
import AddEmployeeForm from "../components/addEmployeeForm/addEmployeeForm.js"


class AddEmployeePage extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <AddEmployeePage />
      </div>
    );
  }
}

export default AddEmployeePage;
